    <style>
        *, *::before, *::after {
            box-sizing: border-box;
        }
        body {
            font-family: 'Roboto', sans-serif;
            background: #f0f2f5;
            padding: 20px;
        }
        .dashboard-grid {
            display: flex;
            gap: 20px;
            margin-bottom: 40px;
            align-items: flex-start;
        }
        .pie {
            flex: 1;
        }
        .uptime {
            flex: 3;
        }
       .plot-container {
            background: white;
            padding: 10px;            
            height: 300px;             /* Fix the height to match layout */
            border-radius: 8px;
            overflow: visible;
            display: block;             
            align-items: center;       /* Optional: center vertically */
            justify-content: center;  /* might cause problems with pie chart? */
        }
        .js-plotly-plot {
            width: 100% !important;
            height: 100% !important;
        }
        .tall-row {
            min-height: 420px;
        }
        .medium-row {
            min-height: 200px;
        }
        .short-row {
            min-height: 150px;
        }
        .row-grid {
            display: grid;
            gap: 20px;
            margin-top: 20px;
            overflow: hidden;
        }
        .three-cols {
            grid-template-columns: repeat(3, 1fr);
        }
        .two-cols {
            grid-template-columns: repeat(2, 1fr);
        }
        .five-cols {
            grid-template-columns: repeat(5, 1fr);
        }    
        @media (max-width: 768px) {
            .dashboard-grid {
                flex-direction: column;
            }
            .three-cols,
            .two-cols,
            .five-cols {
                grid-template-columns: 1fr !important;
            }
            .tall-row, .medium-row, .short-row {
                min-height: auto;
            }
        }
    </style>
</head>
